import React from 'react';
import {withRouter} from 'react-router';
import '../../assets/css/landingPage.css'
import logo from '../../assets/images/logo.svg'
import { WhiteTextField } from '../../assets/inputTypes/inputTypes'
import {makeStyles, createMuiTheme} from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import { ThemeProvider } from '@material-ui/styles';

const theme = createMuiTheme({
    palette: {
        primary: {
        main: '#fff',
        },
    },
});

class LandingPage extends React.Component {
    constructor(props){
        super(props);
        this.state = { buttonDisabled: true};
    }

    handleChange() {
        console.log('Chaning');
    };



    render() {

        return (
            <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p className='inputs'>
                Welcome to the Science Spelling Training.<br/><br/>
                Please enter your name:
                <div className='name-input-container'>
                    <WhiteTextField id="name-input" fullWidth label="Name" variant="outlined" onChange={this.handleChange.bind(this)}/>
                </div>
                </p>

                <ThemeProvider theme={theme}>
                <Button variant="contained" color="primary" size='large' disabled={this.state.buttonDisabled}>
                    Continue
                </Button>
            </ThemeProvider>
            </header>
            </div>
        );
    }
}

export const LandingPageView = withRouter(LandingPage);
